dy="/assets/tablet-expense-CkVtaET5.png",fy="/assets/mobile-DF43oMBV.png",hy="/assets/mobile-expense-5KmJ5lG4.png",py=()=>u.jsxs(u.Fragment,{children:[u.jsxs(dt,{to:"/projects",className:"btn back",children:[u.jsx("span",{className:"accessibility",children:"Back to all projects"}),u.jsx(de,{name:"arrow-right"})]}),u.jsx(Zd,{title:"Expense Calendar",date:"November 2024"}),u.jsx(po,{src:ay,alt:"Expense Calendar desktop mockup"}),u.jsxs(nn,{title:"The Overview",children:[u.jsxs("p",{children:["As someone who wasn't exposed to ",u.jsx("em",{children:"anything"})," about finance until I reached my early adulthood, I had to learn some basic things on my own  like how to budget, open a savings account, and track expenses. One good thing about learning late is that I've got the internet's latest info on the do's and don't's of finance, and I can really pick & choose what works best for me."]}),u.jsx("p",{children:"I've kind of developed a method of tracking my finances in a more visual way. I was mainly doing this in spreadsheets, styling cells to make it look like a calendar so that I knew exactly when my bills were going to hit and to be prepared for them. This was my inspiration for creating my Expense Calendar web app."}),u.jsx("span",{className:"eyebrow",children:"Objective"}),u.jsx("p",{children:"The main reason I ventured into this project was because I wanted to learn more about building sites with React, more specifically React TypeScript. I don't work with any JS frameworks at my day job, so I saw this as a great opportunity to jump into the deep (or medium) end of the React pool."}),u.jsx("p",{children:"Because the placement of dates and days change every month, I had to constantly rewrite my spreadsheet calendar and move my expenses. I wanted to make something that would automatically fill in my expenses each month. And I know, I probably could've just used something like Google Calendar to set this up, but why not make this my own?"}),u.jsx("span",{className:"eyebrow",children:"Technologies"}),u.jsxs("p",{children:["This project was built with ",u.jsx("strong",{children:"Vite"}),", written in ",u.jsx("strong",{children:"React TypeScript"}),", and styled with ",u.jsx("strong",{children:"CSS"}),". A solid foundation in ",u.jsx("strong",{children:"HTML"})," and ",u.jsx("strong",{children:"Vanilla JS"})," also came in handy during this project. We'll get more into the nitty gritty later."]})]}),u.jsxs(nn,{title:"The Breakdown",children:[u.jsx("p",{children:"My goal was to create a visually satisfying, semi-automated method of tracking my expenses. Here's what I needed to do:"}),u.jsxs("ol",{children:[u.jsx("li",{children:"Generate a list of days and display them on a monthly scale."}),u.jsx("li",{children:"Be able to add items to a selected day."}),u.jsx("li",{children:"Be able to apply certain characteristics to these items, i.e. income or expense, frequency, amount, and description."}),u.jsx("li",{children:"Be able to browse through past and future months, as well as the details of each item."})]})]}),u.jsxs(nn,{title:"The Process",children:[u.jsxs("p",{children:["Now, let's get a ",u.jsx("em",{children:"little"})," more technical here."]}),u.jsx("span",{className:"eyebrow",children:"Design"}),u.jsxs("p",{children:["Having spent the last 3.5 years (as of this writing) in the presence of an ",u.jsx("em",{children:"amazing"})," team of designers (shoutout Studio Simpatico), I've humbly picked up a decent eye for UI/UX design. I wanted to design something clean, simple, and easy on the eyes. For starters, I decided to use soft colors, give buttons and popups nice rounded edges, and use a clean sans-serif fontReadex Pro by Google Fonts."]}),u.jsx("p",{children:`I tried to make this app as intuitive as possible (I mean, how complex can a calendar be, honestly). Clicking on a day will open up a popup, in which you can enter the new item's information. Then, just click the "Add" button, or hit the enter key, and you're done!`}),u.jsx("p",{children:`You can also view existing items by clicking on them. Income will be colored a nice calming greenI call it "bok choy green"and expenses will be colored a mildly alarming red"strawberry milk". You'll see its details, as well as an option to delete the item.`})]}),u.jsx(mo,{src1:sy,alt1:"Desktop mockup for adding an expense",src2:uy,alt2:"Desktop mockup showing an expense",animate:!0}),u.jsxs(nn,{children:[u.jsx("span",{className:"eyebrow",children:"Development"}),u.jsx("p",{children:`This was my first go-around at using React to build an interactive UX, so it was truly a learning experience for me. I've heard stories about React hooks, components, and state management, but with this project I was able to get some hands-on experience on how these concepts work "in real life".`}),u.jsx("p",{children:"The useState and useEffect hooks were my main tools of choice for this project, with a sprinkle of useCallback and useRef. The main use cases for the useState hook were to store the data entered into the calendar and to handle some of the logic that controlled the state of the active popups/forms. useEffect was useful for handling existing data, i.e. parsing and displaying the calendar data stored in localStorage, while useCallback was the driver behind the user's ability to add new information to the calendar."}),u.jsxs("p",{children:["If you'd like to take a more detailed look at the implementation, feel free to check out the code ",u.jsx("a",{href:"https://github.com/zethdeluna/zethdeluna/tree/main/src/projects/expense-calendar",target:"_blank",children:"here"}),"!"]})]}),u.jsx(mo,{src1:cy,alt1:"Tablet mockup for the expense calendar app",src2:dy,alt2:"Tablet mockup for the expense calendar app",animate:!0,size:"medium"}),u.jsxs(nn,{title:"The Retro",children:[u.jsx("p",{children:"I believe that no matter how good you are at your craft (or anything, really), there will always be some room left for improvement. I know, I said that this was my first go-around at building a full-on React app, but there were some things I could've done better from the start."}),u.jsxs("p",{children:["I've spent the last few years working under amazing leadership and fellow developers, and we've come together as one well-oiled machine that outputs ultra-neat code and a super organized directory system *chef's kiss. That, unfortunately, didn't exactly carry over when I was getting this project going. My first iteration of this project was ",u.jsx("em",{children:"a mess"}),", and going back to clean things up did take quite a while."]}),u.jsx("p",{children:"Another point I should focus on for my next project would be to build with more clean & efficient functions, and more purposeful state management. I feel like now, after this project has put me through the wringer, I have a much better understanding of React component structures/hierarchy, state management between components, and the general uses of React hooks like useState, useCallback, useEffect, and useRef. I'm hopeful that I can carry my newfound knowledge to the next project, and am excited to continue to learn more!"})]}),u.jsx(mo,{src1:fy,alt1:"Mobile mockup for the expense calendar app",src2:hy,alt2:"Mobile mockup for the expense calendar app",animate:!0,size:"small"}),u.jsx(nn,{children:u.jsx("p",{children:"Thanks so much for stopping by and making it to the end! Please do check out a live demo of this project (link below) and feel free to browse through the repository if interested."})}),u.jsx("section",{className:"project-links",children:u.jsxs("div",{className:"container",children:[u.jsxs(dt,{to:"/projects/demo/expense-calendar",className:"btn heading-2",children:[u.jsx("span",{children:"Demo"}),u.jsx(de,{name:"star"})]}),u.jsxs("a",{className:"btn heading-2",href:"https://github.com/zethdeluna/zethdeluna/tree/main/src/projects/expense-calendar",target:"_blank",children:[u.jsx("span",{children:"Repo"}),u.jsx(de,{name:"star"})]})]})})]}),my="/assets/desktop-BSB-3iv3.png"